import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faTrash,faCirclePlus } from '@fortawesome/free-solid-svg-icons'

const Single = (props, {index}) => {
    return(
        <div className="component">
            <div className="paper-shadow-z-1">
                <input type="text" placeholder="Fibre" id="access-structures" />
                {
                        index ? 
                          <button type="button"  className="button ExtraButton Btn-cables" onClick={(e) => props.removeFormFields(index,e)}><FontAwesomeIcon icon={faTrash} /></button> 
                        : null
                      }
            </div>
        </div>

    )
} 


export default Single;
